import React from 'react';
import { Button, Space } from 'antd';
import { Link } from 'react-router-dom';

const Botao = () => {
  return (
    <div>
      <Button type="primary">
        <Link to="./parametros-form/index">Criar Parâmetro Padrão</Link>
      </Button>
    </div>
  );
};

export default Botao;
